import Data from '../Services/Data'
console.log(Data)
import '../Styles/'


const Films = () => {
    return (
        <>
            <div id='container'>
                {
                    Data.map(film => {
                        return <div key={film.id} className='card'>
                            <img src={film.image} alt='capa'/>
                            <h3>{film.name}</h3>
                            <p>Lançamento:{film.date}</p>

                        </div>
                    })
                }
            </div>
        </>
    )
}

export default Films
